export const styles = {
  wrapper: {
    display: "flex",
    justifyContent: "flex-end",
    alignItems: "center",
    cursor: 'pointer'
  },

  name: {
    color: "#fff",
    fontSize: 14,
    textTransform: "uppercase",
    marginBottom: 0,
    marginRight: 20
  },

  avatar: {
      display: 'block',
      width: 30,
      height: 30,
      borderRadius: '50%',
      backgroundColor: '#fff'
  }
}
